(function(){"use strict";BX.namespace("BX.Main");BX.Main.AdminPageInclude=function(i){this.pagePath=i.pagePath;this.pageParams=i.pageParams;this.init()};BX.Main.AdminPageInclude.prototype.init=function(){BX.addCustomEvent(window,"Grid::beforeRequest",function(i,a){if(BX.type.isNotEmptyString(a.url)){a.url=a.url+(a.url.indexOf("?")<0?"?":"&")+this.pageParams;a.url=BX.util.add_url_param(a.url,{sessid:BX.bitrix_sessid(),public:"Y"})}else{a.url=this.pagePath+"?"+this.pageParams}}.bind(this))}})();